import React from 'react'
import data from "./data.json"
function TestPage() {
    return (
        <div>
            {
                data.posts((post)=>{
                    <img
              src={`https://ytimg.googleusercontent.com/vi/${
                post.url.split('v=')[1]
              }/sddefault.jpg`}
              alt={post.title}
            ></img>
                })
            }
        </div>
    )
}

export default TestPage
